		//抓取推播任務1中已經接到任務者
 		$sql="
		    SELECT
				user.student.uid, 
                user.student.class_code
            FROM user.semester
                INNER JOIN user.class ON
                user.semester.semester_code = user.class.semester_code
				
                INNER JOIN user.student ON
                user.class.class_code = user.student.class_code

            WHERE user.semester.school_code IN(
                'ged','ghf',
				'ghl','zla','glh','zsk',
				'star','bjd','pyd','cte',
				'gsl ','gfd','nif','pnr',
				'wof ','gzj','yre','api',
				'smps','nam','uwn','ivw',
				'did ','lrb','chi','edl',
				'won ','dxu','dsg','jzm','uxo','sgc',
				'zpi','irx','gsz','vqk',
				'gid','cjh','bts','pce',
				'ctc','gnk','gpe','nhe',
				'gdc','csp','gps','cyc',
				'jdy','smb','bnr','nep',
				'dru','nsa','zbq','pqr',
				'wbp'	
            )
                AND user.semester.semester_year=2015
                AND user.semester.semester_term=2
                AND user.class.grade IN (3,4,5)
				AND user.student.uid NOT IN (
				
					SELECT
						mssr_forum.dev_complete_mission_log.accept_uid 
						
					FROM user.semester
						INNER JOIN user.class ON
						user.semester.semester_code = user.class.semester_code
						
						INNER JOIN user.student ON
						user.class.class_code = user.student.class_code
						
						INNER JOIN mssr_forum.dev_complete_mission_log ON
						user.student.uid = mssr_forum.dev_complete_mission_log.accept_uid 
					WHERE user.semester.school_code IN(
						'ged','ghf',
						'ghl','zla','glh','zsk',
						'star','bjd','pyd','cte',
						'gsl ','gfd','nif','pnr',
						'wof ','gzj','yre','api',
						'smps','nam','uwn','ivw',
						'did ','lrb','chi','edl',
						'won ','dxu','dsg','jzm','uxo','sgc',
						'zpi','irx','gsz','vqk',
						'gid','cjh','bts','pce',
						'ctc','gnk','gpe','nhe',
						'gdc','csp','gps','cyc',
						'jdy','smb','bnr','nep',
						'dru','nsa','zbq','pqr',
						'wbp'	
					)
						AND mssr_forum.dev_complete_mission_log.group_task_id = 6
									
				)
        ";
